// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

contract CertificateNFT {
    string private _name = "CertificateNFT";
    string private _symbol = "CERT";
    uint256 private _totalSupply;
    mapping(uint256 => address) private _owners;
    mapping(address => uint256[]) private _ownedCertificates;
    mapping(uint256 => uint256) private _ownedCertificatesIndex;
    mapping(address => uint256) private _balances;
    mapping(uint256 => uint256) private _certificateScores;
    //address public owner;

    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Certification(address indexed owner, uint256 indexed tokenId, uint256 score);

    modifier onlyOwnerOf(uint256 tokenId) {
        require(_owners[tokenId] == msg.sender, "Not certificate owner");
        _;
    }

    /*modifier onlyOwner(){
        require(msg.sender == owner, "Only owner can call this function");       
        _;
    }*/

    /*constructor(address operator) {
        owner = operator;
    }*/

    function name() external view returns (string memory) {
        return _name;
    }

    function symbol() external view returns (string memory) {
        return _symbol;
    }

    function totalSupply() external view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address certOwner) external view returns (uint256) {
        return _balances[certOwner];
    }

    function ownerOf(uint256 tokenId) external view returns (address) {
        return _owners[tokenId];
    }

    function mint(address to, uint256 score) external {
        _totalSupply++;
        _balances[to]++;
        _owners[_totalSupply] = to;
        _certificateScores[_totalSupply] = score;
        _ownedCertificates[to].push(_totalSupply);
        _ownedCertificatesIndex[_totalSupply] = _ownedCertificates[to].length - 1;
        emit Transfer(address(0), to, _totalSupply);
        emit Certification(to, _totalSupply, score);
    }

    function getCertificateScore(uint256 tokenId) external view returns (uint256) {
        return _certificateScores[tokenId];
    }

    function certificatesOfOwner(address certOwner) external view returns (uint256[] memory certificates, uint256[] memory scores) {
        uint256 certCount = _balances[certOwner];
        certificates = new uint256[](certCount);
        scores = new uint256[](certCount);

        for (uint256 i = 0; i < certCount; i++) {
            certificates[i] = _ownedCertificates[certOwner][i];
            scores[i] = _certificateScores[certificates[i]];
        }

        return (certificates, scores);
    }
}

contracts/MetaOperator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "./MetaCert.sol";
import "./MetaTokens.sol";
import "./MetaTree.sol";

contract MetaOperator {
    MetaToken private token;
    TreeNFT private treeNFT;
    CertificateNFT private certNFT;
    address constant public NGOAccount = 0x40d5568Fe100dbC06A5eD91862b85250F54881E2;//MyAccount
    address constant public DAPPAccount = 0xc888636228a82f0F59ABAe53B9850500d0ba1d41;//Tejas Account
    //address public owner;

    constructor(address tokenAddr, address treeNFTAddr, address certNFTAddr) {
       token = MetaToken(tokenAddr);
       treeNFT = TreeNFT(treeNFTAddr);
       certNFT = CertificateNFT(certNFTAddr);
    }

   /* modifier onlyOwner(){
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }*/

    // Token Functions
    function rewardTokens(address account, uint256 amount) external {
        token.reward_tokens(account, amount);
    }

    function transferTokens(address recipient, uint256 amount) external {
        token.transfer(recipient, amount);
    }

    function disburseTokens(uint256 amount) external {
    require(token.balanceOf(msg.sender) >= amount, "Insufficient balance");

    uint256 ngoAmount = (amount * 40) / 100;  // 40% to NGOAccount
    uint256 senderAmount = (amount * 30) / 100; // 30% to msg.sender
    uint256 dappAmount = (amount * 30) / 100; // 30% to DAPPAccount

    token.transfer(NGOAccount, ngoAmount);
    token.transfer(msg.sender, senderAmount);
    token.transfer(DAPPAccount, dappAmount);
}


    function balanceOfTokens(address account) external view returns (uint256) {
        return token.balanceOf(account);
    }

    function approveTokens(address spender, uint256 amount) external {
        token.approve(spender, amount);
    }

    function transferTokensFrom(address sender, address recipient, uint256 amount) external {
        token.transferFrom(sender, recipient, amount);
    }

    // TreeNFT Functions
    function mintTree(address to) external {
        treeNFT.mint(to);
    }

    function getTreeLevel(uint256 tokenId) external view returns (uint256) {
        return treeNFT.getTreeLevel(tokenId);
    }

    function levelUpTree(uint256 tokenId) external {
        treeNFT.levelUp(tokenId);
    }

    function tokensAndLevelsOfTreeOwner(address treeOwner) external view returns (uint256[] memory, uint256[] memory) {
        return treeNFT.tokensOfOwner(treeOwner);
    }

    // CertificateNFT Functions
    function mintCertificate(address to, uint256 score) external {
        certNFT.mint(to, score);
    }

    function getCertificateScore(uint256 tokenId) external view returns (uint256) {
        return certNFT.getCertificateScore(tokenId);
    }

    function certificatesAndScoresOfCertificateOwner(address certOwner) external view returns (uint256[] memory, uint256[] memory) {
        return certNFT.certificatesOfOwner(certOwner);
    }

    function balanceOfCertificateNFT(address certOwner) external view returns (uint256) {
        return certNFT.balanceOf(certOwner);
    }
}

contracts/MetaTokens.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract MetaToken {
    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 private _totalSupply;
    //address public owner;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor(string memory name_, string memory symbol_) {
        _name = name_;
        _symbol = symbol_;
        _decimals = 18;
        //owner = operator;
    }

    /*modifier onlyOwner(){
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }*/

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public returns (bool) {
        require(msg.sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(_balances[msg.sender] >= amount, "ERC20: transfer amount exceeds balance");

        _balances[msg.sender] -= amount;
        _balances[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);

        return true;
    }

    function allowance(address tokenOwner, address spender) public view returns (uint256) {
        return _allowances[tokenOwner][spender];
    }

    function approve(address spender, uint256 amount) public returns (bool) {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);

        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(_balances[sender] >= amount, "ERC20: transfer amount exceeds balance");
        require(_allowances[sender][msg.sender] >= amount, "ERC20: transfer amount exceeds allowance");

        _balances[sender] -= amount;
        _balances[recipient] += amount;
        _allowances[sender][msg.sender] -= amount;

        emit Transfer(sender, recipient, amount);

        return true;
    }

    function reward_tokens(address account, uint256 amount) public {
        require(account != address(0), "ERC20: mint to the zero address");

        _totalSupply += amount;
        _balances[account] += amount;

        emit Transfer(address(0), account, amount);
    }
}

contracts/MetaTree.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

contract TreeNFT {

    string private _name = "TreeNFT";
    string private _symbol = "TREE";
    uint256 private _totalSupply;
    mapping(uint256 => address) private _owners;
    mapping(address => uint256[]) private _ownedTokens;
    mapping(uint256 => uint256) private _ownedTokensIndex;
    mapping(address => uint256) private _balances;
    mapping(uint256 => uint256) private _treeLevels;
    //address public owner;

    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event LevelUp(address indexed owner, uint256 indexed tokenId, uint256 newLevel);

    modifier onlyOwnerOf(uint256 tokenId) {
        require(_owners[tokenId] == msg.sender, "Not token owner");
        _;
    }

    /*constructor(address operator) {
        owner = operator;
    }*/


    /*modifier onlyOwner(){
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }*/

    function name() external view returns (string memory) {
        return _name;
    }

    function symbol() external view returns (string memory) {
        return _symbol;
    }

    function totalSupply() external view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address treeOwner) external view returns (uint256) {
        return _balances[treeOwner];
    }

    function ownerOf(uint256 tokenId) external view returns (address) {
        return _owners[tokenId];
    }

    function mint(address to) external {
        _totalSupply++;
        _balances[to]++;
        _owners[_totalSupply] = to;
        _treeLevels[_totalSupply] = 0;
        _ownedTokens[to].push(_totalSupply);
        _ownedTokensIndex[_totalSupply] = _ownedTokens[to].length - 1;
        emit Transfer(address(0), to, _totalSupply);
    }

    function getTreeLevel(uint256 tokenId) external view returns (uint256) {
        return _treeLevels[tokenId];
    }

    function levelUp(uint256 tokenId) external onlyOwnerOf(tokenId) {
        require(_treeLevels[tokenId] < 15, "Tree is already at max level");
        _treeLevels[tokenId]++;
        emit LevelUp(msg.sender, tokenId, _treeLevels[tokenId]);
    }

    function tokensOfOwner(address treeOwner) external view returns (uint256[] memory tokens, uint256[] memory levels) {
    uint256 tokenCount = _balances[treeOwner];
    tokens = new uint256[](tokenCount);
    levels = new uint256[](tokenCount);

    for (uint256 i = 0; i < tokenCount; i++) {
        tokens[i] = _ownedTokens[treeOwner][i];
        levels[i] = _treeLevels[tokens[i]];
    }
    return (tokens, levels);
}

}

